<script lang="ts">
import Vue from "vue";
import { css } from "@emotion/css";
import celebrate from "./celebrate.png";
import happy from "./happy.png";
import angry from "./angry.png";
import jason from "./jason.jpg";

import { gsap } from "gsap";
import Mousetrap from "mousetrap";
import lineSound from "./lineSound";

export default Vue.extend({
  data() {
    return {
      mainTl: gsap.timeline({
        paused: true,
      }),
      currentMessageIndex: 0,
    };
  },
  computed: {
    images() {
      return {
        celebrate,
        happy,
        angry,
        jason,
      };
    },
    styles() {
      return {
        container: css`
          width: 100vw;
          height: 100vh;
          background-color: #ecb0c3;
        `,
        svg: css`
          opacity: 0;
          width: 100%;
          height: 100%;
          object-fit: contain;
        `,
      };
    },
  },
  beforeDestroy() {
    Mousetrap.unbind("right");
    Mousetrap.unbind("1");
    this.mainTl.kill();
  },
  mounted() {
    const readEls = [
      "message7read",
      "message5read",
      "message3read",
      "message1read",
    ].map((id) => document.getElementById(id));

    gsap.set(readEls, { opacity: 0 });

    gsap.to(document.querySelector("svg"), { opacity: 1, duration: 1 });

    this.mainTl
      .from(
        document.getElementById("message1"),
        { opacity: 0, duration: 0.1 },
        0
      )
      .set(
        document.getElementById("message1read"),
        { opacity: 1, duration: 0.1 },
        1
      )
      .addLabel("message1")
      .from(
        document.getElementById("message2"),
        {
          opacity: 0,
          duration: 0.1,
          onComplete: () => {
            lineSound.play();
          },
        },
        2
      )
      .addLabel("message2")
      .from(
        document.getElementById("message3"),
        { opacity: 0, duration: 0.1 },
        3
      )
      .set(
        document.getElementById("message3read"),
        { opacity: 1, duration: 0.1 },
        4
      )
      .addLabel("message3")
      .from(
        document.getElementById("message4"),
        {
          opacity: 0,
          duration: 0.1,
          onComplete: () => {
            lineSound.play();
          },
        },
        5
      )
      .addLabel("message4")
      .to(document.getElementById("messages"), { y: "-15%", duration: 0.5 }, 6)
      .from(
        document.getElementById("message5"),
        { opacity: 0, duration: 0.1 },
        6
      )
      .set(
        document.getElementById("message5read"),
        { opacity: 1, duration: 0.1 },
        7
      )
      .addLabel("message5")
      .to(
        document.getElementById("messages"),
        {
          y: "-35%",
          duration: 0.5,
          onComplete: () => {
            lineSound.play();
          },
        },
        8
      )
      .from(
        document.getElementById("message6"),
        { opacity: 0, duration: 0.1 },
        8
      )
      .addLabel("message6")
      .to(document.getElementById("messages"), { y: "-55%", duration: 0.5 }, 9)
      .from(
        document.getElementById("message7"),
        { opacity: 0, duration: 0.1 },
        9
      )
      .set(
        document.getElementById("message7read"),
        { opacity: 1, duration: 0.1 },
        10
      )
      .addLabel("message7")
      .to(
        document.getElementById("messages"),
        {
          y: "-75%",
          duration: 0.5,
          onComplete: () => {
            lineSound.play();
          },
        },
        11
      )
      .from(
        document.getElementById("message8"),
        { opacity: 0, duration: 0.1 },
        11
      )
      .addLabel("message8");

    Mousetrap.bind("right", () => {
      if (this.currentMessageIndex < 8) {
        this.currentMessageIndex += 1;
        this.mainTl.tweenTo(`message${this.currentMessageIndex}`);
      }
    });

    Mousetrap.bind("1", () => {
      this.currentMessageIndex = 0;
      this.mainTl.pause(0);
    });
  },
});
</script>
